('196372732', 'Downtown Cairo', '2023-03-18', 'شيفورليه سبارك 2020', 16890, 'Cash', 'امكانيه التقسيط ذوى الاحتياجات سعرها 16890 دولارالسعر يشمل الجواب والترخيص والجماركمتاحه في القاهرة للمعاينه للتواصل على 01124562931او01110555136او01148544456 او الرقم الارضي 0225787129الكماليات والرفاهية الخاصة بالسيارة:مقود كهربائي: هذا المقود افضل من المقود الهيدروليكي حيث انه يعمل بنظام التوجيه بموتور كهربائى صغير مثبت تحت عجلة القيادة فهو يوفر العديد من المزايا مثل: نعومة وسلاسة فى ركن السيارة. قدرة عالية ومرونة أثناء المناورة علي سرعات عالية. لا يحتاج إلى أي صيانة دورية منتظمة. بلوتوث: يمكنك من اقتران الهاتف بالسيارة للرد على المكالمات و تشغيل الوسائط في السيارة. اعدادات التحكم في الصوت من خلال عجلة القيادة: يمكنك التحكم في مستوي الصوت بالسيارة من خلال عجلة القيادة داخل السيارة مما يرفع مستويات الأمان أثناء القيادة حيث يمكنك القيام بخفض أو رفع الصوت بدون الانشغال عن الطريق. مدخل AUX: حيث يمكنك من خلال هذا المخرج توصيل الهواتف مشغلات الملفات الصوتية التي ليس بها بلوتوث بالسيارة والاستماع للملفات الصوتية بجودة عالية. مشغل اسطوانات CD: حيث يمكنك من خلال هذه الميزة الاستماع لملفات الصوت المختلفة والمخزنة على الاسطوانات المدمجة. مدخل USB: تحتوي السيارة على مدخل USB حيث يمكنك من خلاله توصيل الهاتف الخلوي لإعادة شحنه. أقفال آلية للأبواب: بعد السير بالسيارة يتم اغلاق جميع الابواب أوتوماتيكيا. 6 مكبرات الصوت: تمتلك السيارة 6 مكبرات للصوت لتوزيع الصوت بأفضل شكل ممكن داخل السيارة او في الخلف. نظام ملاحة: وهو نظام ملاحة عبر الأقمار الصناعية مصمم خصيصاً للسيارات، وتعمل أنظمة الملاحة داخل السيارة لمعرفة موقع السيارة، كما تسهل على السائق معرفة الطرق وكيفية السير للمكان المطلوب. عجلة القيادة كهربائية: عجلة القيادة كهربائية و مدمجة بـ شاشة الراديو الملونة المتواجدة بمنتصف التابلوه. زر مثبت سرعة: زر خاص على عجلة القيادة يمكنك من خلاله تثبيت سرعة السيارة مباشرة. زر تشغيل السيارة: يمكنك تشغيل السيارة بزر خاص بداخلها دون الحاجة للمفتاح الخاص بالسيارة. شاشة عرض المعلومات: السيارة بها شاشة مخصصة لعرض المعلومات المتعددة عن كل شئ في السيارة والتي تساعد السائق في معرفة جميع الأشياء عن السيارة. تحكم كهربائي بالمقاعد: تمتلك السيارة إمكانية  التحكم الكهربائي بالمقاعد عن طريق ازرار مجهزة للتحكم في المقاعد و تقديم المقعد أو تأخيره دون الحاجة للنظام القديم المزعج. تعديل ميل عجلة القيادة: يمكن للسائق التحكم في ميل وحركة عجلة القيادة على حسب طول قامة السائق. فتح السيارة عن بعد بواسطة ريموت السيارة. حساسات أمامية و خلفية: السيارة تتمتع بوجود حساسات تساعد في الاصطفاف مع وجود كاميرات في السيارة للاصطفاف. مسّاحات مطر اوتوماتيكية: السيارة بها مساحات مطر تعمل اوتوماتيكياً في حالة وجود ماء او امطار، دون الحاجه من السائق في التدخل لتشغيل المساحات. مماسك الأكواب. مرايا الباب إلكترونية. الكنسولة المركزية كبيرة و تتسع للمجلدات أو الأوراق الهامة. عداد المسافة. حامل أكواب أمامي. مشغل اسطوانات. التحكم فى المقعد أوتوماتك. تعديل ميل عجلة القيادة. زجاج كهربائى امامى و خلفى. مصابيح ضباب أمامية فقط. طي المرايات كهربائياً. مشغل CD، MP3، راديو. حساسات خلفية. عجلة القيادة من الجلد. حامل النظارات الشمسية فوق الرأس. جيوب خلفية. مقاعد خلفية قابلة للطى. مزيل ضباب خلفى. مكيف أوتوماتيك. مصابيح أمامية أوتوماتيكية. مساحات للمصابيح الأمامية. ضوء في الصندوق الخلفي. مصابيح أرضية. عادم مزدوج. عرض المعلومات المتعددة. جنوط من الخليط المعدني. دواسات رياضية. مصابيح انعطافات. مقاعد من الجلد.', 'Benzine', 50000, 59999, 'Gray', 'Automatic', 'Sedan', 1400, 1500),
