('196396305', 'Downtown Cairo', '2023-03-18', 'شيفورليه فولت 2012', 13094, 'Cash', 'امكانيه التقسيط حتى 36 شهرعربيه ذوي الاحتياجات سعرها 13094$ السعر يشمل الترخيص والجواب والجمارك فات على فك الحظر 6 شهورعربيه فابريكا بدون رش داخل او خارج السيارهتعمل بمحركين كهربائي وبنزينحصدت (Chevrolet Volt) على تقييم 5/5 في اختبار الأمن والسلامة الوطني الأمريكي، مما يجعلها من أكثر السيارات أمانا في عصرنا الحالي. تحتوي على كاميرا للرؤية الخلفية.  فيها عشر وسائد هوائية موزعة في الداخل لحماية جميع الركاب.  تنبيه السائق بحال وجود مركبة في النقاط العمياء.  استخدام الفولاذ العالي القوة في الأماكن الحرجة من السيارة.  تأتي سيارة شيفروليه فولت بمحركين كهربائي ومحرك بنزين. محرك البنزين يأتي ب 4 سلندر 1500 سي سي، وبقوة 101 حصان، مع خزان وقود بسعة 35 لتر، والمحرك الكهربائي مع بطارية ليثيوم تولد قدرة مقدارها 19 كيلو واط، مما يجعلها سيارة متكاملة وصديقة للبيئة. تستطيع السير بالسيارة مسافة 65 كم عند شحنها كاملا، حيث أظهرت الدراسات أن معظم الناس يسيرون مسافة 65 كم يوميا إلى عملهم ذهابا وإيابا، فنادرا سوف تستخدم محرك الوقود، وسيقلل ذلك اعتمادك على المحروقات بشكل كبير. تمتلك سيارة شيفروليه فولت مظهر خارجي مميز وجذاب، يعطيك إحساسا بالتميز والاناقة. الأداء، تصل سرعة السيارة القصوى إلى 160 كم/ساعة، حيث تعد سيارة عائلية بامتياز. الاتزان على المنعطفات:، تصميم السيارة الديناميكي، ونظام تعليقها المتطور، يعطيان ثبات رائع على المنعطفاتللتواصل على 01110555136 او 01148544456 او الرقم الارضي 0225787129', 'Benzine', 20000, 29999, 'Black', 'Automatic', 'Sedan', 1400, 1500),
